import React, { Component } from "react";
import { connect } from "react-redux";

import Header from "../navigation/Header.js";
import Sidebar from "../navigation/Sidebar.js";
import KPIView from "./KPIView.js";

import { getUsersTotal } from "../../redux/actions/KPIActions";

class DashBoard extends Component {
  async componentDidMount() {
    const t = await this.props.getUsersTotal();

    console.log(t);
  }

  render() {
    return (
      <div className="wrapper">
        <Sidebar />
        <div id="main-panel" className="main-panel" ref="mainPanel">
          <Header title="Dashboard" />
          <KPIView />
        </div>
      </div>
    );
  }
}

const mapStateToProps = state => ({
  userTotal: state.UsersTotal
});

export default connect(mapStateToProps, { getUsersTotal })(DashBoard);
